# ------------------------------------------------------------ 3proxy Configuration File ------------------------------------------------------------

# ----------------------------
# 1. Общие Настройки
# ----------------------------

#include ./conf/

# Указываем DNS-серверы для разрешения имён
nserver 8.8.8.8
nserver 8.8.4.4

# Устанавливаем кэш для DNS-запросов
nscache 65536

# ----------------------------
# 2. Логирование
# ----------------------------

# Настройка логирования
# - Лог-файл: /var/log/3proxy/3proxy.log
# - Тип ротации: H (часовая)
log /var/log/3proxy/3proxy.log H

# Определение формата логирования
# Включает максимально возможные параметры для подробного логирования
logformat "L%Y-%m-%d %H:%M:%S %U %C:%c %R:%r %I/%O %h %T %D %n %p %E %Q %q %e %i %N"

# Параметры ротации логов
# Хранение 24 лог-файлов (по одному за каждый час)
rotate 24

# ----------------------------
# 3. Ограничения по Скорости и Подключениям
# ----------------------------

# Ограничение входящего трафика до 1 Мбит/с для всех пользователей
#bandlimin 1048576 *

# Ограничение исходящего трафика до 1 Мбит/с для всех пользователей
#bandlimout 1048576 *

# Ограничение количества подключений: максимум 100 подключений в минуту для всех пользователей
#connlim 1000 10 *

# Максимальное количество одновременных подключений к прокси-серверу
maxconn 100000

# Установка времени ожидания (таймауты) для различных операций (в секундах)
# BYTE_SHORT BYTE_LONG STRING_SHORT STRING_LONG CONNECTION_SHORT CONNECTION_LONG DNS CHAIN CONNECT CONNECTBACK
timeouts 1 5 30 60 180 1800 15 60 15 5

