# ----------------------------
# 6. Дополнительные Настройки
# ----------------------------

# Установка мониторинга конфигурационного файла для автоматической перезагрузки при изменениях
monitor /etc/3proxy/3proxy.cfg

# Очистка текущих правил и применение новых
flush

# ----------------------------
# 8. Настройки PID-файла (Опционально)
# ----------------------------

# Запись PID процесса 3proxy в файл
pidfile /var/run/3proxy.pid


# ----------------------------
# 11. Настройки Counter (Опционально)
# ----------------------------

# Настройка счетчиков трафика
# Пример: сброс счетчика ежедневно, сохранение в файл counters.dat, отчет в counters_report.txt
counter /var/log/3proxy/counters.dat D counters_report.txt

# ----------------------------
# 14. Настройки File Inclusion (Опционально)
# ----------------------------

# Включение дополнительных конфигурационных файлов
# Например, для разделения конфигурации на несколько файлов
# include /etc/3proxy/includes/additional.cfg

# ----------------------------
# 15. Настройки Stack Size (Опционально)
# ----------------------------

# Изменение размера стека потоков (если необходимо)
stacksize 65536

# ----------------------------
# 16. Завершение Конфигурации
# ----------------------------

# Завершает конфигурационный файл
end
